import axios from "axios";
import baseUrl from "../utils/baseUrl";

//Com useEffect() buscamos dados no client side, 
//mas com getStaticProps fazemos um pre-carregamento,
//deixando mais rapido, use issae é so exportar a funcao que ja funciona.
import ProductList from "../components/Index/ProductList";

function Home(props) {
  return <ProductList products={props.products} />
}

Home.getInitialProps = async (ctx) => {
  const page = ctx.query.page ? ctx.query.page : "1";
  const size = 9
  console.log(page)
  const payload = {
    params: {
      page: page,
      size: size,
    }
  }
  const url = `${baseUrl}/api/products`;
  // fetch data on server
  const response = await axios.get(url, payload);
  // return response data as an object
  return { products: response.data.products };
  // note: this object will be merged with existing props
};


